tring between two pointers\r\n// Input: pBegin - the begin pointer in a string\r\n//        pEnd   - the end pointer in a string\r\n///////////////////////////////////////////////////////////////////////\r\nvoid Reverse(char *pBegin, char *pEnd)\r\n{\r\n      if(pBegin == NULL || pEnd == NULL)\r\n            return;\r\n\r\n      while(pBegin < pEnd)\r\n      {\r\n            char temp = *pBegin;\r\n            *pBegin = *pEnd;\r\n            *pEnd = temp;\r\n\r\n            pBegin ++, pEnd --;\r\n      }\r\n}\r\n///////////////////////////////////////////////////////////////////////\r\n// Reverse the word order in a sentence, but maintain the character\r\n// order inside a word\r\n// Input: pData - the sentence to be reversed\r\n///////////////////////////////////////////////////////////////////////\r\nchar* ReverseSentence(char *pData)\r\n{\r\n      if(pData == NULL)\r\n            return NULL;\r\n\r\n      char *pBegin = pData;\r\n      char *pEnd = pData;\r\n\r\n      while(*pEnd != \'\\0\')\r\n            pEnd ++;\r\n      pEnd--;\r\n\r\n      // Reverse the whole sentence\r\n      Reverse(pBegin, pEnd);\r\n\r\n      // Reverse every word in the sentence\r\n      pBegin = pEnd = pData;\r\n      while(*pBegin != \'\\0\')\r\n      {\r\n            if(*pBegin == \' \')\r\n            {\r\n                  pBegin ++;\r\n                  pEnd ++;\r\n                  continue;\r\n            }\r\n            // A word is between with pBegin and pEnd, reverse it\r\n            else if(*pEnd == \' \' || *pEnd == \'\\0\')\r\n            {\r\n                  Reverse(pBegin, --pEnd);\r\n                  pBegin = ++pEnd;\r\n            }\r\n            else\r\n            {\r\n                  pEnd ++;\r\n            }\r\n      }\r\n\r\n      return pData;\r\n}\r\nint main()\r\n{\r\n	char s[9999];\r\n	gets(s);\r\n	while(s[0]!=0)\r\n	{\r\n		printf(\"%s\\n\",ReverseSentence(s));\r\n		s[0]=0;\r\n		gets(s);\r\n	}\r\n	return 0;\r\n} ','2023-04-25- 02:34:19','Compile Error